Boating accident injuries aren‚Äôt just from a boat crash; it‚Äôs also injuries you sustain while on a boat.

We had a recent case where a charter group went out for some diving, and the boat encountered some pretty serious waves. One wave broke a piece of the boat off, hitting our client in the head and leg, resulting in a host of serious injuries. Thankfully, she is doing much better today.

So, if you are injured on a boat, it‚Äôs important to keep the following steps in mind:

‚Ä¢Report the Accident: Reporting a boat accident preserves the record of events that caused the incident. Failing to report the accident could lead to doubts being put on the legitimacy of your claim. Even if it is uncertain that any damage has been incurred, report any boating accident you have been involved in to the authorities.
‚Ä¢Gather Boater and Insurance Information: It's important to gather as much information on the other boater and any witnesses involved in the incident as possible. Their names, contact, insurance and boat information are all useful when filing a claim and making a case for recovery.
‚Ä¢Seek and Continue Medical Treatment: While most boat accidents cause injuries that are noticeable right away, other accidents may have more subtle consequences. Regardless of what you feel right after an accident, seek medical treatment as soon as possible ‚Äì your doctor might notice things you missed. 
